import { fullData } from "../../mock/trsMock";
import { LOAD_DATA,FILTER_DATA } from "./constants";

export const loadTransactions = () => (dispatch) => {
  dispatch({
    type: LOAD_DATA,
    payload: fullData,
  });
};


export const filterData = (filterFields) => (dispatch) => {
    dispatch({
      type: FILTER_DATA,
      payload: filterFields,
    });
  };
